    "Environmental contaminants in a crossed bill bald eagle recovered in Maine",nt"tracking_summary":
    {ntt"total": 6,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:48:52.316623",nt"name": "environmental-contaminants-in-a-crossed-bill-bald-eagle-recovered-in-maine",nt"isopen":
    false,nt"url": null,nt"notes": "On September 4, 2011, a fledgling female
    bald eagle (Haliaeetus leucocephalus) with a crossedbill was recovered along Pine
    Point Beach in the town of Scarborough, Maine. Local residents reported that the
    eagle had caught a u201cgoodu2010sizeu201d bass near the capture site, but was unable
    to eat the fish. The weakened bird was captured by local police and brought to a
    raptor rehabilitator for veterinary care. However, the bill could not be repaired,
    and the birdu2019s inability to feed itself effectively precluded survival in the
    wild. Therefore, the bird was euthanized. Bill malformations in birds may be related
    to contaminants, nutritional deficiencies, disease, parasites, blunt trauma, or
    genetic abnormalities. Plasma, whole blood, feathers, the liver and brain from the
    bird were collected and analyzed to evaluate whether contaminant levels were elevated.
    Organic and inorganic contaminant levels in brain and liver tissue were not elevated
    compared to concentrations reported in other bald eagle studies in North America
    or suggested threshold toxicity levels. In contrast, organics in plasma and mercury
    in whole blood were elevated and exceeded suggested toxicity threshold levels. Based
    on contradictory analytical results among tissue types, it would be difficult to
    attribute the bald eagle bill malformation to environmental contaminant exposure.",nt"license_title":
